import { Choix } from "./../../Composant/jsx/comp_choix";
function Back_office() {
    return <>
        <div className="box-back-office">
            <Choix titre={"Gestion des ressources humaines"} description={"Gérer les cv, les tests et les entretients des candidats"} src_img={"./app.svg"} />
        </div>
        <button class="button-49" role="button">Button 49</button>
    </>
}
export default Back_office
